import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Login from "./pages/Login";
import authRoutes from "./auth.js";

app.use("/api/auth", authRoutes);


function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />

      </Routes>
    </Router>
  );
}

export default App;
